import React from "react";
import './styles.css';

const Blogs = () => {
    return (
        <div>
            <div className="registration_header">
                <a href={'/'}>Register</a> / &nbsp;
                <a href={'/b'}>Login</a>
            </div>
            <h1 className="heading1">The obligatory blog app in react</h1>
        </div>
    )
}

export default Blogs;
